import React from 'react';
import ComponenteInventarioAuxiliar from './ComponenteInventarioAuxiliar'; // ajusta la ruta si es necesario

const InventarioAdministrador = () => {
  return (
    <div>
      <h1>Inventario Administrador</h1>
      <ComponenteInventarioAuxiliar mensaje="Inventario cargado desde componente auxiliar." />
    </div>
  );
};

export default InventarioAdministrador;
